(21, 'Project Manager', NULL, 'project-manager', 'Active', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><b>REZAID’S</b><span data-contrast=\"none\">&nbsp;</span><b>mission</b><span data-contrast=\"none\">&nbsp;is to challenge the traditional way entrepreneurs develop new technology ideas. We create strategies to revolutionise entire industries through carefully researched and target-led partnerships. We design, build&nbsp;</span><span data-contrast=\"none\">and</span><span data-contrast=\"none\">&nbsp;market digital web solutions that have outstanding customer experience. Our&nbsp;</span><b>vision</b><span data-contrast=\"none\">&nbsp;is to become&nbsp;</span><span data-contrast=\"none\">Pakistan’s</span><span data-contrast=\"none\">&nbsp;first outsourcing technology company with 1m monthly global views by 2024. We&nbsp;</span><b>value</b><span data-contrast=\"none\">&nbsp;our team members, reward their successes, and focus intensely on customer service. </span><span data-ccp-props=\"{\">&nbsp;</span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><span data-contrast=\"none\">Rezaid</span><span data-contrast=\"none\">&nbsp;seeks to hire an experienced and passionate Projects’ Manager to join our expanding team in Lahore. The successful individual will join an established team engaged in developing and implementing&nbsp;</span><span data-contrast=\"none\">cutting edge</span><span data-contrast=\"none\">&nbsp;technology solutions for a global client base. They will be equally&nbsp;</span><span data-contrast=\"none\">comfortable</span><span data-contrast=\"none\">&nbsp;working in digital marketing and software development environments.</span><span data-ccp-props=\"{\">&nbsp;</span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><span data-contrast=\"none\">The Project Manager’s responsibilities include working closely with the heads of digital marketing and software development to create and manage detailed project plans, assign resources and deliver high quality solutions to pre-planned budgets and timescales. They&nbsp;</span><span data-contrast=\"none\">will be expected</span><span data-contrast=\"none\">&nbsp;to lead team brainstorming sessions essential for upholding&nbsp;</span><span data-contrast=\"none\">Rezaid’s</span><span data-contrast=\"none\">&nbsp;commitment to quality.&nbsp;</span><span data-ccp-props=\"{\">&nbsp;</span></p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><span data-contrast=\"none\">The successful candidate should have an exceptional understanding of business IT, management, budgeting and analysis. Only applicants with a strong team ethic and an excellent rounded ‘base skill set’ need apply. This is a highly rewarding and ‘next level’ opportunity for the right person wishing to cement their long-term career in IT and Digital Marketing Project Management.</span><span data-ccp-props=\"{\">&nbsp;</span></p>', '', 'Lahore', 'Development', 'Full Time', '[{\"UID\":\"1607951591418reygvl\",\"Type\":\"text\",\"Name\":\"requirement_1\",\"Value\":\"Ensure staff recruitment is aligned with project budget requirements.\"},{\"UID\":\"1607951591419vsjpch\",\"Type\":\"text\",\"Name\":\"requirement_16079503868702\",\"Value\":\"Coordinate with internal colleagues and clients for the flawless execution of projects.\"},{\"UID\":\"1607951591419ckva2\",\"Type\":\"text\",\"Name\":\"requirement_16079503868703\",\"Value\":\"Measure project performance, produce \\u2018budget vs actual\\u2019 reports.\"},{\"UID\":\"1607951591419y71uiq\",\"Type\":\"text\",\"Name\":\"requirement_16079503868704\",\"Value\":\"Manage changes in project scope, schedule, and costs.\"},{\"UID\":\"16079515914196zs36\",\"Type\":\"text\",\"Name\":\"requirement_16079503868705\",\"Value\":\"Update and share project plans.\"},{\"UID\":\"16079515914192yljwr\",\"Type\":\"text\",\"Name\":\"requirement_16079503868706\",\"Value\":\"Work with Rezaid\\u2019s Technical Managers to manage the Product Backlog Items, organize Sprint reviews and communicate sprint activities.\"},{\"UID\":\"16079515914192t7r8\",\"Type\":\"text\",\"Name\":\"requirement_16079503868707\",\"Value\":\"Act as the key point of contact and communicate project status to all stakeholders including clients and Rezaid\\u2019s senior management team.\"},{\"UID\":\"1607951591419v1du7f\",\"Type\":\"text\",\"Name\":\"requirement_16079503868708\",\"Value\":\"Motivate colleagues and ensure high levels of confidence.\"}]', '[{\"UID\":\"1607951591422v36u8b\",\"Type\":\"text\",\"Name\":\"skills_1\",\"Value\":\"High achieving educational background\"},{\"UID\":\"1607951591422oojabb\",\"Type\":\"text\",\"Name\":\"skills_16079503868702\",\"Value\":\"Experience in the fields of Business Management IT &\\/or Digital Marketing.\"},{\"UID\":\"16079515914222ltk1c\",\"Type\":\"text\",\"Name\":\"skills_16079503868703\",\"Value\":\"At least 3yrs experience in project management\"},{\"UID\":\"1607951591422ljh2cl\",\"Type\":\"text\",\"Name\":\"skills_16079503868704\",\"Value\":\"A comprehensive understanding of the SDLC\"},{\"UID\":\"16079515914220m7to\",\"Type\":\"text\",\"Name\":\"skills_16079503868705\",\"Value\":\"A keen eye for detail\"},{\"UID\":\"1607951591422yrmcw\",\"Type\":\"text\",\"Name\":\"skills_16079503868707\",\"Value\":\"Excellent client facing and internal written and verbal communication skills.\"},{\"UID\":\"1607951591422m8n7hh\",\"Type\":\"text\",\"Name\":\"skills_16079503868708\",\"Value\":\"Solid organisational skills including multi-tasking skills\"},{\"UID\":\"16079515914228f3hw\",\"Type\":\"text\",\"Name\":\"skills_160795038687010\",\"Value\":\"Strong working knowledge of Microsoft Office and web technologies.\"},{\"UID\":\"1607951591422u1w5d6\",\"Type\":\"text\",\"Name\":\"skills_160795038687011\",\"Value\":\"Must have a strong work ethic and be a team player.\"},{\"UID\":\"1607951591422pfmy8\",\"Type\":\"text\",\"Name\":\"skills_160795038687012\",\"Value\":\"Must be able to demonstrate problem solving skills.\"},{\"UID\":\"16079515914220j5jas\",\"Type\":\"text\",\"Name\":\"skills_160795038687013\",\"Value\":\"Hands-on experience of using a project management tool is preferred but not essential\"},{\"UID\":\"1607951591422rm0kqzs\",\"Type\":\"text\",\"Name\":\"skills_160795038687014\",\"Value\":\"PMP certification is a plus.\"}]', '2020-12-14 07:56:20', '2021-04-13 05:26:36'),
(22, 'Front-End Developer', 'HTML CSS', 'php-developer-1', 'Active', '<p>REZAID’S mission is to challenge the traditional way entrepreneurs develop new technology ideas. We create strategies to revolutionise entire industries through carefully researched and target-led partnerships. We design, build and market digital web solutions that have outstanding customer experience. Our vision is to become Pakistan’s first outsourcing technology company with 1m monthly global views by 2024. We value our team members, reward their successes, and focus intensely on customer service. &nbsp;</p><p><br></p><p>We are looking for a qualified Front-end developer to join our IT team. Applicants who hold additional back end expertise are strongly encouraged to apply. You will primarily be responsible for building the ‘client-side’ of our web applications. You should be able to translate our company and customer needs into functional and appealing interactive applications.</p><p><br></p><p>If you’re passionate about creating user-friendly interfaces through writing code and wanting to move forward in your career, then this role is perfect for you. We expect you to be a tech-savvy professional who is curious about new digital technologies and aspires to combine usability with visual design.</p><p><br></p><p>Ultimately, you should be able to fashion functional and attractive digital solutions that ensure outstanding user experiences.</p><div><br></div>', '', 'Lahore', 'UI/UX Design', 'Full Time', '[{\"UID\":\"1608553126685shj5nj\",\"Type\":\"text\",\"Name\":\"requirement_1\",\"Value\":\"Use markup languages like HTML to create user-friendly web pages\"},{\"UID\":\"1608553126685mwukvf\",\"Type\":\"text\",\"Name\":\"requirement_16079506250162\",\"Value\":\"Convert PSD Photoshop designs to HTML\"},{\"UID\":\"16085531266858wbn8\",\"Type\":\"text\",\"Name\":\"requirement_16079506250163\",\"Value\":\"Maintain and improve website\"},{\"UID\":\"160855312668542qe07\",\"Type\":\"text\",\"Name\":\"requirement_16079506250164\",\"Value\":\"Optimize applications for maximum speed\"},{\"UID\":\"1608553126685l9tng8\",\"Type\":\"text\",\"Name\":\"requirement_16079506250165\",\"Value\":\"Design mobile-based features\"},{\"UID\":\"1608553126685m8vpk\",\"Type\":\"text\",\"Name\":\"requirement_16079506250166\",\"Value\":\"Collaborate with back-end developers and web designers to improve usability\"},{\"UID\":\"16085531266853cespe\",\"Type\":\"text\",\"Name\":\"requirement_16079506250167\",\"Value\":\"Get feedback from, and build solutions for, users and customers\"},{\"UID\":\"1608553126685bealir\",\"Type\":\"text\",\"Name\":\"requirement_16079506250168\",\"Value\":\"Write functional requirement documents and guides\"},{\"UID\":\"16085531266855ykjqf\",\"Type\":\"text\",\"Name\":\"requirement_16079506250169\",\"Value\":\"Create quality mockups and prototypes\"},{\"UID\":\"1608553126685uvhh5i\",\"Type\":\"text\",\"Name\":\"requirement_160795062501610\",\"Value\":\"Help back-end developers with coding and troubleshooting\"},{\"UID\":\"1608553126685033ffk\",\"Type\":\"text\",\"Name\":\"requirement_160795062501611\",\"Value\":\"Ensure high quality graphic standards and brand consistency\"},{\"UID\":\"1608553126685tl4bks\",\"Type\":\"text\",\"Name\":\"requirement_160795062501612\",\"Value\":\"Stay up-to-date on emerging technologies\"}]', '[{\"UID\":\"1608553126687p7mipt\",\"Type\":\"text\",\"Name\":\"skills_1\",\"Value\":\"BSc in Computer Science or related field\"},{\"UID\":\"16085531266870bpldh\",\"Type\":\"text\",\"Name\":\"skills_16079506250162\",\"Value\":\"Atleast 2 yrs of proven work experience as a front-end developer\"},{\"UID\":\"1608553126687p4h03y\",\"Type\":\"text\",\"Name\":\"skills_16079506250163\",\"Value\":\"Front end developers having back end experience are actively encouraged to apply.\"},{\"UID\":\"16085531266876c89u\",\"Type\":\"text\",\"Name\":\"skills_16079506250164\",\"Value\":\"Hands-on experience with markup languages\"},{\"UID\":\"160855312668786dh6\",\"Type\":\"text\",\"Name\":\"skills_16079506250165\",\"Value\":\"Experience with JavaScript, CSS and jQuery\"},{\"UID\":\"1608553126687nggd9ho\",\"Type\":\"text\",\"Name\":\"skills_16079506250166\",\"Value\":\"Familiarity with browser testing and debugging\"},{\"UID\":\"1608553126687ttic1i\",\"Type\":\"text\",\"Name\":\"skills_16079506250167\",\"Value\":\"In-depth understanding of the entire web development process (design, development and deployment)\"},{\"UID\":\"1608553126687ydeqfg\",\"Type\":\"text\",\"Name\":\"skills_16079506250168\",\"Value\":\"Understanding of layout aesthetics\"},{\"UID\":\"1608553126687p0ch7h\",\"Type\":\"text\",\"Name\":\"skills_16079506250169\",\"Value\":\"Knowledge of SEO principles\"},{\"UID\":\"160855312668785nwil\",\"Type\":\"text\",\"Name\":\"skills_160795062501610\",\"Value\":\"Familiarity with software like Adobe Suite, Photoshop and content management systems\"},{\"UID\":\"16085531266876byyma\",\"Type\":\"text\",\"Name\":\"skills_160795062501611\",\"Value\":\"Ability to perform well in a fast-paced environment\"},{\"UID\":\"16085531266870t0ld\",\"Type\":\"text\",\"Name\":\"skills_160795062501612\",\"Value\":\"Excellent analytical and multitasking skills\"}]', '2020-12-14 08:00:35', '2021-04-21 03:52:41'),
(23, 'Php Developer', NULL, 'php-developer', 'Active', '<p>REZAID&rsquo;S mission is to challenge the traditional way entrepreneurs develop new technology ideas. We create strategies to revolutionise entire industries through carefully researched and target-led partnerships. We design, build and market digital web solutions that have outstanding customer experience. Our vision is to become Pakistan&rsquo;s first outsourcing technology company with 1m monthly global views by 2024. We value our team members, reward their successes, and focus intensely on customer service. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Rezaid is seeking to hire an experienced PHP developer with a genuine passion for coding. Applicants who hold additional front-end expertise are strongly encouraged to apply. The successful applicant will join our growing software development and digital marketing team in Lahore. They will be expected to grasp new project details quickly, manage their time expertly and deliver high quality software.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>The incumbent will handle back-end developments including but not limited to WordPress, Magento, and Core PHP. A strong understanding of latest industry trends and content management systems is required.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>You will play a key role in our full-stack creative team that is responsible for the SDLC (Software development life cycle) from initial specification designs, through to developing, testing and implementation and handover to support.&nbsp;</p>', 'careers_featured_image_1619520414.PNG', 'Lahore', 'Development', 'Full Time', '[{\"UID\":\"1619587803765t4fyo\",\"Type\":\"text\",\"Name\":\"requirement_1\",\"Value\":\"Write \\u201cclean\\u201d, well-designed code\"},{\"UID\":\"161958780376592w0fr\",\"Type\":\"text\",\"Name\":\"requirement_16079508976862\",\"Value\":\"Produce detailed specifications\"},{\"UID\":\"161958780376591x21r9\",\"Type\":\"text\",\"Name\":\"requirement_16079508976863\",\"Value\":\"Troubleshoot, test and maintain the core product software and databases to ensure strong optimization and functionality\"},{\"UID\":\"1619587803765u1jnfo\",\"Type\":\"text\",\"Name\":\"requirement_16079508976864\",\"Value\":\"Contribute in all phases of the SDLC process\"},{\"UID\":\"1619587803765i1rmxn\",\"Type\":\"text\",\"Name\":\"requirement_16079508976865\",\"Value\":\"Follow industry best practices\"},{\"UID\":\"1619587803765x4jxg8\",\"Type\":\"text\",\"Name\":\"requirement_16079508976866\",\"Value\":\"Develop and deploy new features to facilitate related procedures and tools if necessary\"}]', '[{\"UID\":\"1619587803768nkucbp\",\"Type\":\"text\",\"Name\":\"skills_1\",\"Value\":\"BS\\/MS degree in Computer Science, Engineering or a related subject\"},{\"UID\":\"1619587803768zinulp\",\"Type\":\"text\",\"Name\":\"skills_16079508976862\",\"Value\":\"Atleast 2 years of experience is preferred.\"},{\"UID\":\"1619587803768uyf5cq\",\"Type\":\"text\",\"Name\":\"skills_16079508976863\",\"Value\":\"PHP developer having front end expertise are actively encouraged to apply.\"},{\"UID\":\"1619587803768r74f3i\",\"Type\":\"text\",\"Name\":\"skills_16079508976864\",\"Value\":\"Proven software development experience in PHP\"},{\"UID\":\"1619587803768oo4j3k\",\"Type\":\"text\",\"Name\":\"skills_16079508976865\",\"Value\":\"Understanding of open source projects like Joomla, Drupal, Wikis, osCommerce, etc.\"},{\"UID\":\"1619587803768jln9v\",\"Type\":\"text\",\"Name\":\"skills_16079508976866\",\"Value\":\"Demonstrable knowledge of web technologies including HTML, CSS, Javascript, AJAX etc.\"},{\"UID\":\"1619587803768q1lvks\",\"Type\":\"text\",\"Name\":\"skills_16079508976867\",\"Value\":\"Good knowledge of relational databases, version control tools, and developing web services\"},{\"UID\":\"1619587803768kucupk\",\"Type\":\"text\",\"Name\":\"skills_16079508976868\",\"Value\":\"Experience of common third-party APIs (Google, Facebook, Ebay etc)\"},{\"UID\":\"1619587803768hikg\",\"Type\":\"text\",\"Name\":\"skills_16079508976869\",\"Value\":\"Passion for best design and coding practices and a desire to develop new bold ideas\"},{\"UID\":\"1619587803768pul6ze\",\"Type\":\"text\",\"Name\":\"skills_160795089768610\",\"Value\":\"Ability to meet strict deadlines.\"},{\"UID\":\"1619587803768dn5o57\",\"Type\":\"text\",\"Name\":\"skills_160795089768611\",\"Value\":\"Punctual at work\"},{\"UID\":\"16195878037684rv27h\",\"Type\":\"text\",\"Name\":\"skills_160795089768612\",\"Value\":\"Should be a team oriented person and also willing to work in isolation\"}]', '2020-12-14 08:04:01', '2021-04-28 00:30:04');
