(3, 'About Us', 'about-us', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Innovation and staying ahead of the curve are 2 sides of the same coin for growing businesses. At Rezaid, we understand that for many UK companies it is hard to source and retain experienced technical talent, which is essential to constantly drive their ambition, given the shortage of skills this sector is facing.</p>\r\n<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"font-size: 1rem;\">However Asian countries are experiencing a technology boom with a glut of high-quality software engineers, many of whom have experience of working in the UK.</span></p>\r\n<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"font-size: 1rem;\">So, how can fast growing, innovative and ambitious SME&rsquo;s take advantage of this overseas talent?</span></p>\r\n<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\"><span style=\"font-size: 1rem;\">That&rsquo;s where we come in. Based in Manchester, Rezaid (UK) forms one half of an exclusive partnership with its sister company, Rezaid (Asia). Together, we provide bespoke software development services to close the productivity gap of high growth UK SMEs. Sharing single ownership, both halves of the partnership benefit from a common operational structure, and free flow of staff and ideas from within the UK and Asia.</span></p>', '[{\"UID\":\"161665048944612ik3\",\"Type\":\"text\",\"is_image\":\"1\",\"Name\":\"file16166502971822\",\"Value\":\"pages_custom_image_1616650317.png\",\"Custom_Attribute\":\"File\"}]', 'f3dc589e872a7bf723d0a7de316d061e.png', 'Publish', '2020-12-10 02:36:48', '2021-03-25 00:34:49'),
(4, 'Rezaid’s Story', 'rezaids-story', '<div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><h2 data-fontsize=\"40\" data-lineheight=\"48\" style=\"color: rgb(51, 51, 51); margin-right: 0px; margin-bottom: 30px; margin-left: 0px; font-family: Montserrat; font-weight: 600; letter-spacing: 0.5px; font-size: 40px;\">Background</h2><div class=\"grammarly-disable-indicator\"></div><div class=\"grammarly-disable-indicator\"></div><div class=\"grammarly-disable-indicator\"></div></div><div class=\"fusion-sep-clear\" style=\"clear: both; height: 1px; font-size: 0px; line-height: 0; width: 1079.22px; overflow: hidden; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"></div><div class=\"fusion-separator sep-single sep-solid\" style=\"border-width: 4px 0px 0px; border-style: solid; border-color: rgb(20, 102, 53); border-image: initial; clear: both; position: relative; z-index: 11; height: auto; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px; margin-bottom: 53.9531px; width: 100px; max-width: 100px;\"></div><div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">In 2001, cardiac scientist turned technology entrepreneur, Dr Moneeb co-founded eSAY solutions Ltd an award-winning software outsourcing consultancy based in Manchester. For the first 10 years, eSAY developed bespoke software solutions for UK SMEs, achieving steady organic growth annually. In 2010, Moneeb invited a South African tech entrepreneur to invest in the company which led to the creation of&nbsp;<a href=\"https://www.workmobileforms.com/\" style=\"color: rgb(19, 102, 52); transition-property: color, background-color, border-color; transition-duration: 0.2s; transition-timing-function: linear;\">WorkMobile</a>; the world’s first mobile data capture service to run on mobile platforms and PCs.</p><div></div></div><div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><h2 data-fontsize=\"40\" data-lineheight=\"48\" style=\"color: rgb(51, 51, 51); margin-right: 0px; margin-bottom: 30px; margin-left: 0px; font-family: Montserrat; font-weight: 600; letter-spacing: 0.5px; font-size: 40px;\">The Problem</h2></div><div class=\"fusion-sep-clear\" style=\"clear: both; height: 1px; font-size: 0px; line-height: 0; width: 1079.22px; overflow: hidden; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"></div><div class=\"fusion-separator sep-single sep-solid\" style=\"border-width: 4px 0px 0px; border-style: solid; border-color: rgb(20, 102, 53); border-image: initial; clear: both; position: relative; z-index: 11; height: auto; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px; margin-bottom: 53.9531px; width: 100px; max-width: 100px;\"></div><div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Globally, high-end IT skills have an ever-increasing demand which leads to inflated recruitment and wage costs, and consequently, an acknowledged skills gap. While there is a real and present danger to sustained innovation for UK SMEs, large businesses’ approach to tackling this problem has been to invest in global centers of technical excellence in lower wage economies, thereby embedding continuous innovation and quality into their products. This approach is clearly beyond reach for innovative UK SMEs. They are left with costly choices, such as recruiting temporary contract workers and junior staff, working with “partners”, working with technical companies which take a share in equity for their services etc.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">For WorkMobile, originally based in Manchester, a limited and costly local talent pool was proving to be an obstacle to its growth. Not only were good software engineers difficult to attract, they were costly to retain. In 2014, after investigating different outsourcing and offshoring models for WorkMobile’s software development needs, Moneeb founded Rezaid Asia, a software house to specifically design, build and test WorkMobile’s technology platform, and established a long-term, long-distance bespoke software development service.</p><div></div><div></div></div><div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><h2 data-fontsize=\"40\" data-lineheight=\"48\" style=\"color: rgb(51, 51, 51); margin-right: 0px; margin-bottom: 30px; margin-left: 0px; font-family: Montserrat; font-weight: 600; letter-spacing: 0.5px; font-size: 40px;\">The Solution</h2><div class=\"grammarly-disable-indicator\"></div></div><div class=\"fusion-sep-clear\" style=\"clear: both; height: 1px; font-size: 0px; line-height: 0; width: 1079.22px; overflow: hidden; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"></div><div class=\"fusion-separator sep-single sep-solid\" style=\"border-width: 4px 0px 0px; border-style: solid; border-color: rgb(20, 102, 53); border-image: initial; clear: both; position: relative; z-index: 11; height: auto; color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px; margin-bottom: 53.9531px; width: 100px; max-width: 100px;\"></div><div class=\"fusion-text\" style=\"color: rgb(14, 17, 32); font-family: Montserrat; letter-spacing: 0.8px;\"><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">After 3 years of perfecting its outsourcing model, Rezaid UK launched its bespoke development services under Rezaid Asia, so that these services can be utilised by high growth UK SMEs.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Rezaid UK and Rezaid Asia’s partnership is a cost-effective, multifaceted model that benefits its clients in several ways:</p><ul><li>Speed of service- our innovative recruitment model enables us to begin new projects or scale existing ones quickly</li><li>Quality of service- our projects incorporate rigorous quality control through a multi-step software testing life cycle</li><li>Affordability- we transfer operational costs savings to our customers.</li><li>Ownership- our unique ownership model incorporates local accountability, IP protection and strict quality standards via contracting through Rezaid UK. Furthermore, by establishing this partnership, understanding of cultural differences is key, and is clearly communicated and maintained throughout the relationship.</li></ul><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Rezaid offers powerful, high quality and cost-effective bespoke software services to SMEs in UK.</p></div>', '[]', 'd5bb063f2c8356781a98791b1964a320.png', 'Publish', '2020-12-10 07:17:48', '2020-12-14 07:41:39');
