(5, 'Founder and CEO', 'founder-and-ceo', '<div class=\"person-shortcode-image-wrapper\" style=\"text-align: center; color: #0e1120; font-family: Montserrat; letter-spacing: 0.8px;\"><img class=\"\" style=\"width: 25%;\" src=\"data:image/jpeg;base64,\" data-filename=\"dr-moneeb-awan.jpg\" />\r\n<div class=\"person-image-container hover-type-none\" style=\"display: inline-block; z-index: 1; max-width: 100%; vertical-align: bottom; border-radius: 50%;\">&nbsp;</div>\r\n</div>\r\n<div class=\"person-desc\" style=\"margin-top: 0px; color: #0e1120; font-family: Montserrat; letter-spacing: 0.8px; text-align: center; padding: 40px;\">\r\n<div class=\"person-author\" style=\"width: 999.219px;\">\r\n<div class=\"person-author-wrapper\" style=\"font-size: 24px; vertical-align: middle; float: none; min-width: 50%; width: 999.219px; font-weight: 600; line-height: 1.5; letter-spacing: 1px;\"><span class=\"person-name\" style=\"color: #333333; display: block;\">Dr. Moneeb Awan</span></div>\r\n</div>\r\n<div class=\"person-content fusion-clearfix\" style=\"clear: both; zoom: 1; margin-top: 25px;\">Phd, Biochemistry | Co-founder of Esay | Ex-President Greater Manchester Chamber of Commerce | Founder and CEO of Rezaid</div>\r\n</div>', '[{\"UID\":\"1615977888420rz6xoc\",\"Type\":\"text\",\"is_image\":\"1\",\"Name\":\"file16159778722472\",\"Value\":\"pages_custom_image_1615977886.png\",\"Custom_Attribute\":\"File\"}]', 'pages_featured_image_1615977736.png', 'Publish', '2020-12-10 07:19:48', '2021-03-17 05:44:48');
